          <button>BUY</button>
        </div>
        <div className=" py-3  rounded-lr-3xl rounded-tr\l-3xl bg-gradient-to-t from-yellow-600 via-amber-200 to-yellow-500">
          <div className="flex justify-between">
            <div>
              <img src={fb} height={30} width={20} className="ms-3" />
            </div>
            <div className="flex me-6">
              <img
                src={coin}
                height={30}
                width={20}
                className="ms-3 relative -right-4"
              />
              <p className="bg-pink-900 rounded-full px-9 text-center text-white">
                100,214,474
              </p>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

